import React from "react";
import "./Cards.css";
import cat from '../../assets/fatma.jpg'
function Cards({ profileImage }) {
  return (
    <div className="containercard">
      <div className="container">
        <div className="card">
          <div className="front">
            <div className="card-top">
              <p className="card-top-para">Profile</p>
            </div>

            <img src={profileImage} alt="Profile" className="profile-image" />

            <p className="heading">Front Card</p>
            <p className="follow">Follow me for more...</p>
          </div>
          <div className="back">
            <p className="heading">Follow Me</p>

            {/* Utilisez également profileImage ici pour la photo de profil au verso */}
            <img src={profileImage} alt="Profile" className="profile-image" />

            <div className="icons">
              {/* Vos icônes de médias sociaux */}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Cards;
